import React from 'react';
import ReactDOM from 'react-dom/client';
import image from "./images/galaxy2.jpg";
import "./App.css";


function App() {
  return (
    <div  style={{backgroundImage: `url(${image})`,
    height:'100vh',
    backgroundSize:'cover',
    backgroundRepeat : 'no-repeat',
    backgroundPosition:'centre',
    position: 'static'
    }}>
      <Form/>
    </div>
  );
}

function Form(){
 return( <div style={{
    backgroundColor:'darkgrey',
    width:'25%',
    height:'40%',
    position:'absolute',
    marginLeft:'35%',
    marginTop:'15%',
    padding:'20px'
  }}>
    <p className='Login'>Login</p>
    <form>
        <label>
          Username : <input type="text" className='Lab'/>
        </label><br/>
        <label>
          Password : <input type="text" className='Lab'/>
        </label>
    </form>
  </div>);
}

export default App;
